Casa Duplex, estilo colonial 
 Privacidade
 Em localização nobre, privilegiada e estratégica do charmoso Bairro Bandeirantes!
 245m2 de área construída em lote de 1.000m2


 Térreo:
 *Varanda e jardim frontal;
 *02 Salas sendo 01 com pé direito duplo;
 * 01 quarto;
 *Lavabo;
 *Cozinha estilo americana;
 *Despensa;
 *Lavanderia;
 *DCE;

 Mezanino:
 *Hall de circulação;
 *Banho social equipado com armários, espelho e box em vidro temperado
 *03 quartos amplos. Todos os quartos equipados com armários. Suíte master equipada com hidromassagem. Varanda em 02 dos quartos

 Área externa livre (térreo /fundos):
 * 01 anexo totalmente independente com suíte;
 * Piscina
 * Quiosque;
 * Jardim amplo com área verde livre (árvores frutíferas: limão, amora, siriguela)
 Acabamento: tecnocimento (cimento queimado) / cerâmica.


 Garagem:
 04 vagas com capacidade para 05 carros

 Destaque: 
 Privacidade!
 Casa aconchegante, confortável, clara, arejada, cômodos amplos. 
 Casa possui Habite-se
